import React, { Component } from "react";
import ListItem from './ListItem.jsx';

export default class List extends Component {
    pieces = [["Piece1", "/images/Image1.jpg"],
    ["Piece2", "/images/Image2.JPG"], ["Piece3", "Image3.JPG"]];
    render() {
        const listpiece = pieces.map((piece) =>
            <ListItem name={piece[0]} src={piece[1]} />
        );
        return <List>{listpiece}</List>;
    }
}
